import React from "react";
import { HashRouter, Route } from "react-router-dom";
import About from "./routes/About";

function App() {
  return (
    <HashRouter>
      <Route path="/about" component={About} />
    </HashRouter>
  );
}
// route에는 중요한 게 두개 들어간다. 하나는 렌더링할 스크린, 다른 prop는 뭐할지 들어간다
export default App;
